exports=async function(bid,options){const{parseInfo}=await require("transcode/parse_info"),url=`https://wap.biqupai.com/${bid.idPrefix()}_${bid}/`;return parseInfo("\u65B0\u7B14\u8DA3\u9601",url,"meta",{clientOptions:{...(options&&options.clientOptions)}}).then(_=>(_.cover&&(_.cover=_.cover.replace("xxbiquge.net","biqupai.com")),_))};